import React from "react";
const Header = () =>{
     return(
     <div>
       <h1 className="port-header"> Mohit Kulkarni</h1>
       <p>Completed my education at Jawaharlal Nehru Engineering.
                        My father is a businessman, managing his own enterprise,
                        while my mother is a dedicated housewife
                        I have a younger sister who brings
                        joy and energy to our family.</p>
                    <p>Inspired by my father's entrepreneurial spirit, I am eager to apply my education and skills to
                        contribute to the success of his enterprise or explore new opportunities in the business realm.
                        My father's guidance and mentorship have been invaluable in shaping my understanding of the
                        business world.

                        My mother, a dedicated housewife, has been the pillar of support for our family. Her nurturing
                        presence has created a warm and harmonious environment at home. I have always admired her
                        resilience and ability to balance the responsibilities of a homemaker.</p>

     </div>
      );
};
export default Header;
